// CategoryData.js
export const categories = [
    {
      name: '유니티',
      posts: [
        { name: '폴더1', type: 'folder' },
        { name: '파일1', type: 'file' },
        // 더 많은 항목 추가 가능
      ],
    },
    // 다른 카테고리 추가 가능
  ];
